    P01 => 0.1,
    P1  => 1,
    P3  => 3,
    P5  => 5,
    P10 => 10,
    P15 => 15,
    P25 => 25,
    P50 => 50,
    P75 => 75,
    P85 => 85,
    P90 => 90,
    P95 => 95,
    P97 => 97,
    P99 => 99,
    P999 => 99.9,
);
my %zscores = (
    SD4neg => -4,
    SD3neg => -3,
    SD2neg => -2,
    SD1neg => -1,
    SD0    => 0,
    SD1    => 1,
    SD2    => 2,
    SD3    => 3,
    SD4    => 4,
);

sub _interpolate {
    my ($x, $x1, $y1, $x2, $y2) = @_;
    sprintf "%.1f", $y1 + ($y2-$y1)/($x2-$x1)*($x-$x1);
}

sub _get_value_at_pct {
    my ($row, $meta, $pct) = @_;
    if    ($pct <   0.1) { undef }
    elsif ($pct <=  1  ) { _interpolate( $pct, 0.1 => $row->[ $meta->{fields}{P01}{pos} ],  1   => $row->[ $meta->{fields}{P1}{pos} ]) }
    elsif ($pct <=  3  ) { _interpolate( $pct,  1  => $row->[ $meta->{fields}{P1}{pos}  ],  3   => $row->[ $meta->{fields}{P3}{pos} ]) }
    elsif ($pct <=  5  ) { _interpolate( $pct,  3  => $row->[ $meta->{fields}{P3}{pos}  ],  5   => $row->[ $meta->{fields}{P5}{pos} ]) }
    elsif ($pct <= 10  ) { _interpolate( $pct,  5  => $row->[ $meta->{fields}{P5}{pos}  ], 10   => $row->[ $meta->{fields}{P10}{pos} ]) }
    elsif ($pct <= 15  ) { _interpolate( $pct, 10  => $row->[ $meta->{fields}{P10}{pos} ], 15   => $row->[ $meta->{fields}{P15}{pos} ]) }
    elsif ($pct <= 25  ) { _interpolate( $pct, 15  => $row->[ $meta->{fields}{P15}{pos} ], 25   => $row->[ $meta->{fields}{P25}{pos} ]) }
    elsif ($pct <= 50  ) { _interpolate( $pct, 25  => $row->[ $meta->{fields}{P25}{pos} ], 50   => $row->[ $meta->{fields}{P50}{pos} ]) }
    elsif ($pct <= 75  ) { _interpolate( $pct, 50  => $row->[ $meta->{fields}{P50}{pos} ], 75   => $row->[ $meta->{fields}{P75}{pos} ]) }
    elsif ($pct <= 85  ) { _interpolate( $pct, 75  => $row->[ $meta->{fields}{P75}{pos} ], 85   => $row->[ $meta->{fields}{P85}{pos} ]) }
    elsif ($pct <= 90  ) { _interpolate( $pct, 85  => $row->[ $meta->{fields}{P85}{pos} ], 90   => $row->[ $meta->{fields}{P90}{pos} ]) }
    elsif ($pct <= 95  ) { _interpolate( $pct, 90  => $row->[ $meta->{fields}{P90}{pos} ], 95   => $row->[ $meta->{fields}{P95}{pos} ]) }
    elsif ($pct <= 97  ) { _interpolate( $pct, 95  => $row->[ $meta->{fields}{P95}{pos} ], 97   => $row->[ $meta->{fields}{P97}{pos} ]) }
    elsif ($pct <= 99  ) { _interpolate( $pct, 97  => $row->[ $meta->{fields}{P97}{pos} ], 99   => $row->[ $meta->{fields}{P99}{pos} ]) }
    elsif ($pct <= 99.9) { _interpolate( $pct, 99  => $row->[ $meta->{fields}{P99}{pos} ], 99.9 => $row->[ $meta->{fields}{P999}{pos} ]) }
    else { undef }
}

$SPEC{get_who_growth_reference} = {
    v => 1.1,
    summary => 'Lookup height/weight in the WHO growth chart (a.k.a. growth reference, growth standards)',
    description => <<'_',

Caveats:

Currently the z-zcore line values (e.g. height_Z1, height_Z-1, etc) are
calculated using linear interpolation.

_
    args => {
        gender => {
            schema => ['str*', in=>['M', 'F']],
            req => 1,
            pos => 0,
        },
        now => {
            summary => 'Assume now is this date, instead of current date',
            schema => 'date*',
        },
        dob => {
            schema => ['date*'],
            pos => 1,
        },
        age => {
            schema => ['duration*'],
        },
        height => {
            summary => 'Specify height to calculate percentile',
            schema => ['float*', xmin=>0],
            cmdline_aliases => {H=>{}},
        },
        weight => {
            summary => 'Specify weight to calculate percentile',
            schema => ['float*', xmin=>0],
            cmdline_aliases => {W=>{}},
        },
    },
    args_rels => {
        req_one => ['dob', 'age'],
        dep_any => ['now', ['dob']],
    },
};
sub get_who_growth_reference {
    no strict 'refs';
    require TableData::Lookup;

    my %args = @_;
    my $gender = $args{gender};

    my ($days, $months, $months_f);
    if ($args{dob}) {
        my $dob = $args{dob};
        my $now = $args{now} // time();
        $days     = int(($now - $dob)/86400);
        $months   = int(($now - $dob)/86400/30.4375);
        $months_f = sprintf "%.1f", $months;
    } elsif ($args{age}) {
        my $age = $args{age};
        $days     = int($age / 86400);
        $months   = int($age / 86400/30.4375);
        $months_f = sprintf "%.1f", $months;
    } else {
        return [400, "Please specify age or dob"];
    }

    return [412, "Negative age entered"] if $days < 0;
    return [412, "Over 19 years of age"] if $months > 19*12;

    my $res = [200, "OK", {}];

    $res->[2]{gender} = $gender;
    $res->[2]{age} = "$months_f month(s)";

  GET_HEIGHT_FOR_AGE: {
        my $name = "height_".($gender eq 'M' ? 'boy' : 'girl');
        my $name_potential = $name;
        my $idx;
        if ($days > 1856) {
            $name .= '_5_19y';
            $idx = $months - 61;
        } else {
            $name .= "_0_5y";
            $idx = $days;
        }
        $name_potential .= '_5_19y';

        my $data_potential = ${"data_${name_potential}_pct"};
        my $row_potential  = $data_potential->[-1];

      GET_PCT: {
            my $meta = ${"meta_${name}_pct"};
            my $data = ${"data_${name}_pct"};

            my $row = $data->[$idx];

            $res->[2]{height_mean} = $row->[ $meta->{fields}{P50}{pos} ];

            for (keys %percentiles) {
                $res->[2]{"height_$_"} = $row->[ $meta->{fields}{$_}{pos} ]
                    if $meta->{fields}{$_};
            }
            last unless defined $args{height};
            my $pct = TableData::Lookup::table_vlookup(
                table => [map { [
                    $row->[ $meta->{fields}{$_}{pos} ],
                    $percentiles{$_},
                ] } grep { $meta->{fields}{$_} }
                    sort {$percentiles{$a} <=> $percentiles{$b}}
                    keys %percentiles],
                lookup_value => $args{height},
                lookup_field => 0,
                result_field => 1,
                approx       => 1,
                interpolate  => 1,
            );
            $res->[2]{height_percentile} = $pct;
            $res->[2]{height_potential_SD0} = $row_potential->[ $meta->{fields}{P50}{pos} ];
            $res->[2]{height_potential} = TableData::Lookup::table_vlookup(
                table => [map { [
                    $percentiles{$_},
                    $row_potential->[ $meta->{fields}{$_}{pos} ],
                ] } grep { $meta->{fields}{$_} }
                    sort {$percentiles{$a} <=> $percentiles{$b}}
                    keys %percentiles],
                lookup_value => $pct,
                lookup_field => 0,
                result_field => 1,
                approx       => 1,
                interpolate  => 1,
            );
        }
      GET_Z: {
            my $meta = ${"meta_${name}_z"};
            my $data = ${"data_${name}_z"};

            my $row = $data->[$idx];

            for (keys %zscores) {
                $res->[2]{"height_$_"} = $row->[ $meta->{fields}{$_}{pos} ]
                    if $meta->{fields}{$_};
            }
            last unless defined $args{height};
            my $z = TableData::Lookup::table_vlookup(
                table => [map { [
                    $row->[ $meta->{fields}{$_}{pos} ],
                    $zscores{$_},
                ] } grep { $meta->{fields}{$_} }
                    sort {$zscores{$a} <=> $zscores{$b}}
                    keys %zscores],
                lookup_value => $args{height},
                lookup_field => 0,
                result_field => 1,
                approx       => 1,
                interpolate  => 1,
            );
            $res->[2]{height_zscore} = $z;
        }
  }

  GET_WEIGHT_FOR_AGE: {
        my $name = "weight_".($gender eq 'M' ? 'boy' : 'girl');
        my $name_potential = $name;
        my $idx;
        if ($months > 60) {
            $name .= '_5_10y';
            $idx = $months - 61;
        } else {
            $name .= "_0_5y";
            $idx = $months;
        }
        $name_potential .= '_5_10y';

        my $data_potential = ${"data_${name_potential}_pct"};
        my $row_potential  = $data_potential->[-1];

      GET_PCT: {
            my $meta = ${"meta_${name}_pct"};
            my $data = ${"data_${name}_pct"};

            my $row = $data->[$idx];

            $res->[3]{'func.raw_weight'} = $row;
            $res->[2]{weight_mean} = $row->[ $meta->{fields}{P50}{pos} ];

            for (keys %percentiles) {
                $res->[2]{"weight_$_"} = $row->[ $meta->{fields}{$_}{pos} ]
                    if $meta->{fields}{$_};
            }
            last unless defined $args{weight};
            my $pct = TableData::Lookup::table_vlookup(
                table => [map { [
                    $row->[ $meta->{fields}{$_}{pos} ],
                    $percentiles{$_},
                ] } grep { $meta->{fields}{$_} }
                    sort {$percentiles{$a} <=> $percentiles{$b}}
                    keys %percentiles],
                lookup_value => $args{weight},
                lookup_field => 0,
                result_field => 1,
                approx       => 1,
                interpolate  => 1,
            );
            $res->[2]{weight_percentile} = $pct;
        }
      GET_Z: {
            my $meta = ${"meta_${name}_z"};
            my $data = ${"data_${name}_z"};

            my $row = $data->[$idx];

            for (keys %zscores) {
                $res->[2]{"weight_$_"} = $row->[ $meta->{fields}{$_}{pos} ]
                    if $meta->{fields}{$_};
            }
            last unless defined $args{weight};
            my $z = TableData::Lookup::table_vlookup(
                table => [map { [
                    $row->[ $meta->{fields}{$_}{pos} ],
                    $zscores{$_},
                ] } grep { $meta->{fields}{$_} }
                    sort {$zscores{$a} <=> $zscores{$b}}
                    keys %zscores],
                lookup_value => $args{weight},
                lookup_field => 0,
                result_field => 1,
                approx       => 1,
                interpolate  => 1,
            );
            $res->[2]{weight_zscore} = $z;
        }
    }

  GET_BMI_FOR_AGE: {
        my $name = "bmi_".($gender eq 'M' ? 'boy' : 'girl');
        my $idx;
        if ($months > 60) {
            $name .= '_5_19y';
            $idx = $months - 61;
        } elsif ($months > 24) {
            $name .= '_2_5y';
            $idx = $months - 24;
        } else {
            $name .= "_0_2y";
            $idx = $months;
        }

        my $bmi;
        if (defined $args{height} && defined $args{weight}) {
            $bmi = $args{weight} / ($args{height}/100)**2;
            $res->[2]{bmi} = $bmi;
        }

      GET_PCT: {
            my $meta = ${"meta_${name}_pct"};
            my $data = ${"data_${name}_pct"};

            my $row = $data->[$idx];

            $res->[2]{bmi_mean} = $row->[ $meta->{fields}{P50}{pos} ];

            for (keys %percentiles) {
                $res->[2]{"bmi_$_"} = $row->[ $meta->{fields}{$_}{pos} ]
                    if $meta->{fields}{$_};
            }
            last unless defined $bmi;
            my $pct = TableData::Lookup::table_vlookup(
                table => [map { [
                    $row->[ $meta->{fields}{$_}{pos} ],
                    $percentiles{$_},
                ] } grep { $meta->{fields}{$_} }
                    sort {$percentiles{$a} <=> $percentiles{$b}}
                    keys %percentiles],
                lookup_value => $bmi,
                lookup_field => 0,
                result_field => 1,
                approx       => 1,
                interpolate  => 1,
            );
            $res->[2]{bmi_percentile} = $pct;
        }
      GET_Z: {
            my $meta = ${"meta_${name}_z"};
            my $data = ${"data_${name}_z"};

            my $row = $data->[$idx];

            for (keys %zscores) {
                $res->[2]{"bmi_$_"} = $row->[ $meta->{fields}{$_}{pos} ]
                    if $meta->{fields}{$_};
            }
            last unless defined $bmi;

            my $z = TableData::Lookup::table_vlookup(
                table => [map { [
                    $row->[ $meta->{fields}{$_}{pos} ],
                    $zscores{$_},
                ] } grep { $meta->{fields}{$_} }
                    sort {$zscores{$a} <=> $zscores{$b}}
                    keys %zscores],
                lookup_value => $bmi,
                lookup_field => 0,
                result_field => 1,
                approx       => 1,
                interpolate  => 1,
            );
            $res->[2]{bmi_zscore} = $z;
        }
    }

    $res;
}

1;
# ABSTRACT: Lookup height/weight in the WHO growth chart (a.k.a. growth reference, growth standards)

=pod

=encoding UTF-8

=head1 NAME

WHO::GrowthReference::Table - Lookup height/weight in the WHO growth chart (a.k.a. growth reference, growth standards)

=head1 VERSION

This document describes version 0.008 of WHO::GrowthReference::Table (from Perl distribution WHO-GrowthReference-Table), released on 2021-02-27.

=head1 SYNOPSIS

 use WHO::GrowthReference::Table qw(get_who_growth_reference);

 # get mean height & weight of a 3-year old girl

 my $res = get_who_growth_reference(gender => "F", dob => time() - 3*365.25*86400);
 # => [200, "OK", {
 #      age => "36.0 month(s)",
 #      height_mean => 95.034, # cm
 #      weight_mean => 13.9,   # kg
 #      height_P01  => ..., # height at 0.1% percentile
 #      height_P1   => ..., # height at 1% percentile
 #      height_Z-3  => ..., # height at -3 SD
 #      height_Z-2  => ..., # height at -2 SD
 #      ...
 #     }]

 # you have a 3.5-year old boy weighing at 14.8kg and with a height of 102cm,
 # calculate the percentiles

 my $res = get_who_growth_reference(gender => "M", dob => time() - 3.5*365.25*86400, weight=>14.8, height=>102);
 # => [200, "OK", {
 #      age => "42.0 month(s)",
 #      height_mean => 99.844, # cm
 #      height_percentile => 70.2, # your boy's height is above world average, about 70.2% of boys of the same age are shorter than your boy
 #      height_zscore => ...,
 #      weight_mean => 15.3,   # kg
 #      weight_percentile => 39.6, # your boy's weight is below world average, about 39.6% of boys of the same age weigh less than your boy
 #      weight_zscore => ...,
 #      height_P01 => ...,
 #      ...
 #      height_potential => ...,
 #      height_potential_Z0 => ...,
 #      weight_potential_10y => ...,
 #      weight_potential_10y_Z0 => ...,
 #     }]

=head1 FUNCTIONS


=head2 get_who_growth_reference

Usage:

 get_who_growth_reference(%args) -> [status, msg, payload, meta]

Lookup heightE<sol>weight in the WHO growth chart (a.k.a. growth reference, growth standards).

Caveats:

Currently the z-zcore line values (e.g. height_Z1, height_Z-1, etc) are
calculated using linear interpolation.

This function is not exported by default, but exportable.

Arguments ('*' denotes required arguments):

=over 4

=item * B<age> => I<duration>

=item * B<dob> => I<date>

=item * B<gender>* => I<str>

=item * B<height> => I<float>

Specify height to calculate percentile.

=item * B<now> => I<date>

Assume now is this date, instead of current date.

=item * B<weight> => I<float>

Specify weight to calculate percentile.


=back

Returns an enveloped result (an array).

First element (status) is an integer containing HTTP status code
(200 means OK, 4xx caller error, 5xx function error). Second element
(msg) is a string containing error message, or 'OK' if status is
200. Third element (payload) is optional, the actual result. Fourth
element (meta) is called result metadata and is optional, a hash
that contains extra information.

Return value:  (any)

